import { BrowserRouter, Route } from "react-router-dom";

import CreateProduct from "./CreateProduct";
import DeleteProduct from "./DeleteProduct";
import ReadProducts from "./ReadProducts";
import UpdateProduct from "./UpdateProduct";

const AdminPage = () => {
  return (
    <div>
      <BrowserRouter>
        <div className="contenedor_principal">
          <div className="contenedor_menu_vertical">
            <MenuNav />
          </div>
          <div className="contenedor_contenidos">
            <Route exact path="/productos/">
              <ReadProducts />
            </Route>
            <Route exact path="/nuevo_producto/">
              <CreateProduct />
            </Route>
            <Route exact path="/editar_producto/">
              <UpdateProduct />
            </Route>
            <Route exact path="/borrar_producto/">
              <DeleteProduct />
            </Route>
          </div>
        </div>
      </BrowserRouter>
    </div>
  );
};

export default AdminPage;
